package hello

import (
    "fmt"
    "net/http"
)

func init() {
    http.HandleFunc("/", handler)
}

func handler(w http.ResponseWriter, r *http.Request) {
	var contents string = `
<html>
	<head>
		<title>A Dog Named Luke</title>
		<style>
			body {width:600px; margin:0px auto;}
			h2 {font-family:arial}
			p {font-family:arial}
		</style>
	</head>
	<body>
		<p>&nbsp;</p>

		<h2>A Dog Named Luke</h2>

		<table><tr>
		<td><img src="data:image/jpeg;base64," /></td>
		<td><img src="data:image/jpeg;base64," /></td>
		</tr></table>

		<p>If you have come to this page, you've most likely found our dog, Luke.
			We hope the information that we have posted here will be helpful until we are 
			able to connect up with you. Please give the telephone numbers listed on his tag
			a call or send us a text. We are generally very quick to check text and 
			voice mail assuming we have coverage.
		</p>
		
		<p>If you haven't been able to tell, he's very friendly and loving. He loves humans,
			adults and kids. He's fine around other (non-aggressive) dogs. He is also more or less OK
			with cats, but if they run he thinks it's a game and will chase them. Most
			cats don't find this amusing. 
		</p>
		
		<p>Luke is generally an indoor dog. He'll do outside, but he doesn't generally 
			spend more than 30 minutes outside without humans around. If it isn't too much 
			of an imposition, please let him inside, but he'll understand if he has to be
			outside. If you let him inside just lay a blanket down infront of him, he'll 
			probably get the idea that this is his spot and once he's done greeting everyone
			he'll settle down there... unless you are cooking. :) 
		</p>
		
		<p>Speaking of food... He eats around 7am and 6pm. He's not much of a kibble eater, but 
			if you have some around it's worth a try. Otherwise, mix some rice and chicken, or
			something similar, and I'm sure he'll wolf it down. He usually follows a meal down 
			with a bowl of water.
		</p>

		<p>If you aren't sure what to do with him, and have some extra time and energy, he loves walks.
			Be sure to bring a couple of little plastic bags with you. You never know with him. The walk 
			will tire him out pretty well. He's an older dog, so he usually falls asleep by 7 or 8pm and
			will sleep until around 7am. He'll give a new husky howl in the morning when he's ready to 
			go outside. Don't panic, you should have time to get dressed and releave yourself first,
			assuming you want to take him for an early morning walk. :)
		</p>

		<p>That's the rundown on Luke. Our vet is the <a href="http://cheneyvet.com/">Cheney Veterinary Clinic</a>.
			Please give them a call if Luke is having problems. Thanks for taking care of him. We appreciate it, 
			and so does he.
		</p>

		<p>John and Nancy Gasper
		</p>

	</body>
</html>
`

    fmt.Fprint(w, contents)
}
